    children: []
    langs:
      - typeScript
    type: property
    summary: >-
      The reference data set key comparison behavior can be set using this
      property. By default, the

      value is 'Ordinal' - which means case sensitive key comparison will be
      performed while joining

      reference data with events or while adding new reference data. When
      'OrdinalIgnoreCase' is

      set, case insensitive comparison will be used. Possible values include:
      'Ordinal',

      'OrdinalIgnoreCase'
